export var ValueState;
(function (ValueState) {
    ValueState["Error"] = "Error";
    ValueState["None"] = "None";
    ValueState["Success"] = "Success";
    ValueState["Warning"] = "Warning";
    ValueState["Information"] = "Information";
})(ValueState || (ValueState = {}));
